import { About } from "../About/about";

const pageList = [
    {
        id: -1,
        name: 'about',
        component: <About/>
    }
];

// Sets the id of each page to it's index in list.
const setUpIdOfPages = () => {
    pageList = pageList.map((page, index) => {
        page.id = index;
        return page;
    })
}

export const pages = () => {
    setUpIdOfPages();
    return pageList;
}
